import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 13.1-525.1 Fees to cover expense of regulation.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/13.1-525.1.md","filePath":"vacode/13.1-525.1.md"}'),o={name:"vacode/13.1-525.1.md"},s=r('<h1 id="§-13-1-525-1-fees-to-cover-expense-of-regulation" tabindex="-1">§ 13.1-525.1 Fees to cover expense of regulation. <a class="header-anchor" href="#§-13-1-525-1-fees-to-cover-expense-of-regulation" aria-label="Permalink to &quot;§ 13.1-525.1 Fees to cover expense of regulation.&quot;">​</a></h1><p>The fees paid into the state treasury under this chapter, except for fees and funds collected for the Literary Fund, shall be deposited into a special fund and specifically accounted for and used by the State Corporation Commission to defray the costs of supervising, implementing, and administering the provisions of this chapter and Chapters 6 (§ <a href="http://law.lis.virginia.gov/vacode/13.1-528/" target="_blank" rel="noreferrer">13.1-528</a> et seq.) and 8 (§ <a href="http://law.lis.virginia.gov/vacode/13.1-557/" target="_blank" rel="noreferrer">13.1-557</a> et seq.) of this title, and Chapters 6.1 (§ <a href="http://law.lis.virginia.gov/vacode/59.1-92.1/" target="_blank" rel="noreferrer">59.1-92.1</a> et seq.) and 7 (§ <a href="http://law.lis.virginia.gov/vacode/59.1-93/" target="_blank" rel="noreferrer">59.1-93</a> et seq.) of Title 59.1. Included in the Commission&#39;s costs shall be a reasonable margin in the nature of a reserve fund. All excesses of fees collected exceeding these costs shall revert to the general fund.</p><p>1987, c. 434.</p>',3),n=[s];function i(l,c,d,f,h,p){return t(),a("div",null,n)}const g=e(o,[["render",i]]);export{v as __pageData,g as default};
